import React, { Component } from 'react';


export default class Chart extends Component {

    

    // fetch data from the database using the API endpoint and store in variable
    render() {
        return (
            <div>
                <h2>Data</h2>
                <tbody>
                <tr>
                  <th>Name</th>
                  <th>Last Name</th>
                  <th>Age</th>
                  <th>Occupation</th>
                </tr>
                
                  <tr>
                    <td>Name</td>
                    <td>Lastt</td>
                    <td>Age</td>
                    <td>Occupa</td>
                  </tr>
          </tbody>
            </div>
        )
    }
}
